        <video
    id="my-player"
    src={promo1}
    className="video-js"
    controls={false}
    muted="muted"
    loop={true}
    autoPlay={true}
    preload="auto"
    data-setup='{}'>
 
</video>
        </div>

    </div>
    );
}
 
export default Login;
